import React from "react";
import Carousel from "react-bootstrap/Carousel";
import Back from "./back.png";
import Front from "./front.png";
// import axios from "axios";
import "./card.css";

const Car = (props) => {
return (
  <div> <h4>Place Card Here</h4>
  <Carousel>
    <Carousel.Item>
      <img
        className="cardBack"
        src={Back}
        alt="Card Back"
      />
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="cardFront"
        src={Front}
        alt="Card Front"
      />
    </Carousel.Item>
  </Carousel>
  </div>
)
  
}

export default Car;
